mapper.delete:

delete from t_financial_student
where stuId = #{stuId,jdbcType=INTEGER}
  and proId = #{proId,jdbcType=INTEGER}

mapper.update:

update t_financial_student
set proName = #{proName,jdbcType=VARCHAR},
  proMoney = #{proMoney,jdbcType=VARCHAR},
  proEndTime = #{proEndTime,jdbcType=TIMESTAMP},
  proTime = #{proTime,jdbcType=TIMESTAMP},
  proState = #{proState,jdbcType=VARCHAR}
where stuId = #{stuId,jdbcType=INTEGER}
  and proId = #{proId,jdbcType=INTEGER}

mapper.select:

select stuId, proId, proName, proMoney, proEndTime, proTime, proState
from t_financial_student
where stuId = #{stuId,jdbcType=INTEGER}
  and proId = #{proId,jdbcType=INTEGER}
